import React from "react";
import { useNavigate } from "react-router-dom";
import PanelCard from "./PanelCard";
import { FaHome, FaClipboardList } from "react-icons/fa";
import "./DaycarePanel.css";

const DaycarePanel = () => {
  const navigate = useNavigate();

  return (
    <div className="daycarePanel-section">
      <h1>Welcome to the Daycare Panel</h1>
      <p>Manage your daycare tasks, monitor bookings, and view schedules with ease.</p>

      <div className="daycarePanel-content">
        {/* Manage Daycare Profile */}
        <div className="daycarePanel-card-group">
          <div className="daycarePanel-card" onClick={() => navigate("/daycareRegiForm")}>
            <FaHome size={70} className="daycarePanel-icon" />
          </div>
          <button className="daycarePanel-btn" onClick={() => navigate("/daycareRegiForm")}>
            Manage Daycare Profile
          </button>
        </div>

        {/* Manage Bookings */}
        <div className="daycarePanel-card-group">
          <div className="daycarePanel-card" onClick={() => navigate("/findDaycareBooking")}>
            <FaClipboardList size={70} className="daycarePanel-icon" />
          </div>
          <button className="daycarePanel-btn" onClick={() => navigate("/findDaycareBooking")}>
            Manage Bookings
          </button>
        </div>
      </div>
    </div>
  );
};

export default DaycarePanel;
